    color: $active-color

=font-face($family: null, $style: normal, $weight: 400, $locals: null, $urls: null, $unicodes: null)
  $src: null
  @if $locals
    @each $local in $locals
      @if $src
        $src: "#{$src}, local('#{$local}')"
      @else
        $src: "local('#{$local}')"
  @if $urls
    @each $format, $url in $urls
      @if $src
        $src: "#{$src}, url(#{$url}) format('#{$format}')"
      @else
        $src: "url(#{$url}) format('#{$format}')"
  @at-root
    @font-face
      src: unquote($src)
      font-family: $family
      font-style: $style
      font-weight: $weight
      unicode-range: $unicodes

=_media-query($breakpoints, $breakpoint, $query-rule, $minus-value: 0)
